import { Link } from 'react-router-dom'

export default function Nav () {

  return(
    <div className='nav'>
      <Link to ='/'>Home</Link>
      <Link to ='/contact' >Contact</Link>
      <Link to ='/portfolio'>Portfolio</Link>
      <Link to ='/resume'>Resume</Link>
      <Link to ='/linkedin'>linkedin</Link>
    </div>
  )
}
